s[0] = "Introduction^Introduction.html^Introduction^     <p>Here is the documentation of the Emuteca's source code.    <p><a href=\"http://pasdoc.sipsolutions.net/PasDoc\">PasDoc</a> was selected for documentation by two reasons:    <p></p>    <ol class=\"paragraph_spacing\">    <li value=\"1\"><p>I don't like Lazarus' LazDoc with the comments in other file.</p></li>    <li value=\"2\"><p>Lazarus itself recognizes PasDoc comments, specially <code>{&lt;</code> to show them in tooltips (I like the comments after the declarations, but before the implementation). Then, when the mouse pointer is over something the tooltips are not messed with the previous thing declared.</p></li>  </ol>    <p>    <p>Previously, when Delphi was used for compilation, <a href=\"http://delphidoc.sourceforge.net/\">JADD</a> has been used. Maybe it's more powerfull as you can more things that to document the code; for example, to do the user's manual or the offline help...    <p><h2 class=\"\"><a name=\"License\"></a>License</h2>      <p>Copyright (C) 2006-2011 Chixpy    <p>This source is free software; you can redistribute it and/or modify it under the terms of the GNU General Public <a class=\"normal\"  href=\"Introduction.html#License\">License</a> as published by the Free Software Foundation; either version 3 of the <a class=\"normal\"  href=\"Introduction.html#License\">License</a>, or (at your option) any later version.    <p>This code is distributed in the hope that it will be useful, but WITHOUT ANY WARRANTY; without even the implied warranty of MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE. See the GNU General Public <a class=\"normal\"  href=\"Introduction.html#License\">License</a> for more details.    <p>A copy of the GNU General Public <a class=\"normal\"  href=\"Introduction.html#License\">License</a> is available on the World Wide Web at <a href=\"http://www.gnu.org/copyleft/gpl.html\">GNU's Web Site</a>. You can also obtain it by writing to the Free Software Foundation, Inc., 59 Temple Place - Suite 330, Boston, MA 02111-1307, USA.  Emuteca's source code documentation^0"
