s[1201] = "u7zWrapper^u7zWrapper.html^Simple 7z.exe AND 7zG.exe wrapper until something better is found.^    <p></p>    <dl class=\"paragraph_spacing\">    <dt>NOTE:</dt>    <dd><p>7z.exe and 7zG.exe have their own licenses.</p></dd>  </dl>    <p>    <p></p>    <dl class=\"paragraph_spacing\">    <dt>NOTE:</dt>    <dd><p>Because PascalScript don't suport overloaded methods, we don't use them right here.</p></dd>  </dl>    <p> ^0"
s[1202] = "u7zWrapper.w7zException^u7zWrapper.w7zException.html^^ ^0"
s[1203] = "u7zWrapper.kw7zCacheFileExt^u7zWrapper.html#kw7zCacheFileExt^^ ^0"
s[1204] = "u7zWrapper.w7zExeError^u7zWrapper.html#w7zExeError^Translatable string: '7z.exe/7zG.exe returned %0:d exit code'^ ^0"
s[1205] = "u7zWrapper.w7zFileNotFound^u7zWrapper.html#w7zFileNotFound^Translatable string: '&quot;%0:s&quot; file not found'^ ^0"
s[1206] = "u7zWrapper.w7zCompressFile^u7zWrapper.html#w7zCompressFile^Compress files in a 7z (or other type) archive.^    <p>      a7zArchive Name of the 7z/zip archive. aFileList List of files to add to the archive. ShowProgress If true, progress of decompression will be shown. CompType Type of the archive. Exit code ^0"
s[1207] = "u7zWrapper.w7zExtractFile^u7zWrapper.html#w7zExtractFile^Extract de file (or files) from 7z archive.^    <p>       aFilename Name of the 7z archive. aFolder Folder where the file(s) will be extracted. aFileMask Mask or file to extract. Remember, for 7z.exe '*' means all files, not '*.*' wich means all files with extension. ShowProgress If true, progress of decompression will be shown. Password Password for 7z archive. Exit code ^0"
s[1208] = "u7zWrapper.w7zListFiles^u7zWrapper.html#w7zListFiles^List files and properties in a 7z (or other format) archive.^    <p>Executes &quot;7z.exe l -slt aFilename&quot; but don't use wildcards.    <p>7zG.exe can't list files so always 7z.exe is used, and console is hidden.    <p>       aFilename Name of the 7z archive. PackedFiles StringList where the files will be added. If the StringList = nil will be created (and you must free it, of course), otherwise it will be cleared. If OnlyPaths = <code>False</code>, every string have the following format for easy TStringList.CommaText reading: &quot;Dir/Filename&quot;,&quot;size&quot;,&quot;packed size&quot;,&quot;Date modified&quot;,&quot;CRC&quot; OnlyPaths List only file names and no properties UseCache Use cached file list? Password Is there archives that need a password to list files? Just in case. Exit code ^0"
s[1209] = "u7zWrapper.w7zCacheDir^u7zWrapper.html#w7zCacheDir^Directory were lists of files from compressed archives are stored.^    <p>Defaults to '%USERTEMPDIR%/w7zCache', and the directory is deleted at program exit. ^0"
s[1210] = "u7zWrapper.w7zFileExts^u7zWrapper.html#w7zFileExts^String with suported file extensions by 7z.^    <p>Format: 'ext,ext,ext' for easy creating a TStringList. At least until we found a better way for searching files with different extension.    <p>Warning: It's not used for test if the files passed as params are compressed files. It's only a reference list. ^0"
s[1211] = "u7zWrapper.w7zPathTo7zexe^u7zWrapper.html#w7zPathTo7zexe^Path to 7z.exe executable.^    <p>It can be usefull for hidding the process, but it's needed for listing archives anyways. ^0"
s[1212] = "u7zWrapper.w7zPathTo7zGexe^u7zWrapper.html#w7zPathTo7zGexe^Path to 7zG.exe executable.^ ^0"
