s[1378] = "uGame.cGame.SortKey^uGame.cGame.html#SortKey^Title formated for sorting purposes.^    <p>It contains the <a class=\"normal\"  href=\"uGame.cGame.html#Name\">name</a> for sorting: </p>    <ul class=\"paragraph_spacing\">    <li><p>Articles <i>The</i> or <i>A</i> at the end of the <a class=\"normal\"  href=\"uGame.cGame.html#Name\">name</a>. &quot;<i>The Emuteca collection</i>&quot; -&gt; &quot;<i>Emuteca collection, The</i>&quot;. If title is in another language, its rules will be used.</p></li>    <li><p>The fancy characters will be trasliterated to latin ones. Obviusly, if original <a class=\"normal\"  href=\"uGame.cGame.html#Name\">name</a> is a trasliteration from words in latin, original words will be used. As example: Final Fantasy in Japanese is <i></i>, trasliteration is <i>Fainaru Fantaj</i> but here will be <i>Final Fantasy</i>.</p></li>  </ul>    <p> ^0"
s[1379] = "uGame.cGame.Tags^uGame.cGame.html#Tags^<code>Tags</code> for grouping games.^    <p>Format: Generic/Especific (Players/1 player; Series/Batman; Genre/Shot'm up; Perspective/2.5D; Location/Europe/Spain) ^0"
